const Question = props => {
    return (
        <>
        <h1>{props.question}</h1>
        <div class="btn-group-vertical">
            {
                props.incorrect.map((each) => 
                <button type="button" class="btn btn-outline-info">{each}</button>
                )

            }
            <button type="button" class="btn btn-outline-info">{props.correct}</button>
        </div>
        </>
    )
}

export default Question;
